import React from 'react';
import { Link, useNavigate } from "react-router-dom";
import './ContactoFooter.css';
const ContactoFooter = () => {
  return (

    <div className="contactoFooter">
    <table>
      <tbody className="d-flex">
       
        <div className="menssageFooter" >
            <form>
          <div className="mb-3">
            <label for="FormControlInput1" className="form-label">Email</label>
            <input type="email" className="form-control" id="FormControlInput1" placeholder="name@gmail.com" />
          </div>
          <div className="mb-3">
            <label for="FormControlMenssage" className="form-label">Menssage</label>
            <textarea className="form-control" id="FormControlMenssage" rows="3"></textarea>
          </div>
          <div className="d-flex flex-wrap ">
                    <Link className="btn btn-info" to={"#"}
                        style={{ color: 'white', fontFamily: 'Arial, sans-serif' }}>
                       Enviar
                    </Link>
                    <span style={{ marginRight: '10px' }}></span>
                </div>
                </form>
        </div>
      </tbody>
    </table>

  </div>

  );
}

export default ContactoFooter;
